let cardsContent = [];
    const cardsCsvUrl = "/is-bin/intershop.static/WFS/WuerthGroup-Wuerth-Site/3143-B1/en_US/Landing_pages/2025/02_februar/2025_01_katalogy_10.csv";
    const cards_csv__split_character = ';';
    $(document).ready(function () {
        $.ajax({
            type: "GET",
            url: cardsCsvUrl,
            async: true,
            cache: false,
            dataType: "text",
            success: function (data) {
                parseCardsData(data);
            }
        });
    });
    function parseCardsData(data) {
        var lines = data.split(/\r\n|\n/);
        var headings = lines[0].split(cards_csv__split_character);
        for (var j = 1; j < lines.length; j++) {
            var values = lines[j].split(cards_csv__split_character);
            if (values[0] == '') {
                break;
            }
            let item = { "image": values[0], "url": values[1], "title": values[2], 'desc': values[3], 'btnTtile': values[4] }
            cardsContent.push(item);
        }
        generateCardsHtml();
    }
    function generateCardsHtml() {
        for (let i = 0; i < cardsContent.length; i++) {
            let cHtml = '<div class="col-12 col-sm-6 col-md-4 mb-3" style="margin-bottom: 0;">' +
                '<div class="card" style="border: 1px solid #dcdcdc !important;">' +
                '<div class="row no-gutters">' +
                '<a class="mx-auto" href="' + cardsContent[i].url + '">' +
                '<img class="card-img-top lazyload"' +
                'data-src="' + cardsContent[i].image + '" />' +
                '</a>' +
                '<div class="card-body" style="padding: 2.2rem; min-height: 0; border-top: 3px solid #cc0000">' +
                '<h2 class="card-title heading-alt"' +
                'style="text-transform: uppercase; font-family: wuerthextra_bold_cond;">' + cardsContent[i].title + '</h2>' +
                '<p class="card-text">' + cardsContent[i].desc + '</p>' +
                '<div class="col p-0"><a class="btn btn-block btn-info" style="min-width: 220px;"' +
                'href="' + cardsContent[i].url + '">' + cardsContent[i].btnTtile + '</a></div>' +
                '</div>' +
                '</div>' +
                '</div>' +
                '</div>';
            $('.main-cards-container').append(cHtml);
        }
    }
